contracts/DiamondFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./DiamondPair.sol";

contract DiamondFactory is Ownable {
  // Events
  event PairCreated(address indexed token0, address indexed token1, address pair, uint);

  // State variables
  mapping(address => mapping(address => address)) public getPair;
  address[] public allPairs;

  // Protocol fee settings
  address public feeTo;
  uint public protocolFeeDenominator = 5; // 1/5 of the 0.3% fee = 0.06%

  // Create a new pair
  function createPair(address tokenA, address tokenB) external returns (address pair) {
      require(tokenA != tokenB, 'DiamondFactory: IDENTICAL_ADDRESSES');
      (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
      require(token0 != address(0), 'DiamondFactory: ZERO_ADDRESS');
      require(getPair[token0][token1] == address(0), 'DiamondFactory: PAIR_EXISTS');

      // Create new pair contract
      bytes memory bytecode = type(DiamondPair).creationCode;
      bytes32 salt = keccak256(abi.encodePacked(token0, token1));
      assembly {
          pair := create2(0, add(bytecode, 32), mload(bytecode), salt)
      }

      // Initialize the pair
      DiamondPair(pair).initialize(token0, token1);

      // Store the pair
      getPair[token0][token1] = pair;
      getPair[token1][token0] = pair; // populate mapping in both directions
      allPairs.push(pair);

      emit PairCreated(token0, token1, pair, allPairs.length);
  }

  // Set the fee recipient
  function setFeeTo(address _feeTo) external onlyOwner {
      feeTo = _feeTo;
  }// Set the protocol fee denominator
  function setProtocolFeeDenominator(uint _protocolFeeDenominator) external onlyOwner {
      require(_protocolFeeDenominator > 0, 'DiamondFactory: INVALID_DENOMINATOR');
      protocolFeeDenominator = _protocolFeeDenominator;
  }

  // Get all pairs length
  function allPairsLength() external view returns (uint) {
      return allPairs.length;
  }
}

contracts/DiamondPair.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

interface IDiamondFactory {
  function feeTo() external view returns (address);
  function protocolFeeDenominator() external view returns (uint);
}

contract DiamondPair is ERC20, ReentrancyGuard {
  using SafeMath for uint;

  // Constants
  uint public constant MINIMUM_LIQUIDITY = 10**3;

  // State variables
  address public factory;
  address public token0;
  address public token1;

  uint112 private reserve0;
  uint112 private reserve1;
  uint32 private blockTimestampLast;

  uint public price0CumulativeLast;
  uint public price1CumulativeLast;
  uint public kLast; // reserve0 * reserve1, as of immediately after the most recent liquidity event

  // Events
  event Mint(address indexed sender, uint amount0, uint amount1);
  event Burn(address indexed sender, uint amount0, uint amount1, address indexed to);
  event Swap(
      address indexed sender,
      uint amount0In,
      uint amount1In,
      uint amount0Out,
      uint amount1Out,
      address indexed to
  );
  event Sync(uint112 reserve0, uint112 reserve1);

  // Modifiers
  modifier onlyFactory() {
      require(msg.sender == factory, 'DiamondPair: FORBIDDEN');
      _;
  }

  constructor() ERC20("Diamondz LP Token", "DMDZ-LP") {
      factory = msg.sender;
  }

  // Initialize the pair with tokens
  function initialize(address _token0, address _token1) external onlyFactory {
      token0 = _token0;
      token1 = _token1;
  }

  // Update reserves and, on the first call per block, price accumulators
  function _update(uint balance0, uint balance1, uint112 _reserve0, uint112 _reserve1) private {
      require(balance0 <= type(uint112).max && balance1 <= type(uint112).max, 'DiamondPair: OVERFLOW');
      uint32 blockTimestamp = uint32(block.timestamp % 2**32);
      uint32 timeElapsed = blockTimestamp - blockTimestampLast;

      // Simplified price accumulation
      if (timeElapsed > 0 && _reserve0 != 0 && _reserve1 != 0) {
          // Update price accumulators using simple division
          if (_reserve0 > 0) {
              price0CumulativeLast += (uint(_reserve1) * 1e18 / _reserve0) * timeElapsed;
          }
          if (_reserve1 > 0) {
              price1CumulativeLast += (uint(_reserve0) * 1e18 / _reserve1) * timeElapsed;
          }
      }

      reserve0 = uint112(balance0);
      reserve1 = uint112(balance1);
      blockTimestampLast = blockTimestamp;
      emit Sync(reserve0, reserve1);
  }

  // Mint liquidity tokens
  function mint(address to) external nonReentrant returns (uint liquidity) {
      (uint112 _reserve0, uint112 _reserve1,) = getReserves();
      uint balance0 = IERC20(token0).balanceOf(address(this));
      uint balance1 = IERC20(token1).balanceOf(address(this));
      uint amount0 = balance0.sub(_reserve0);
      uint amount1 = balance1.sub(_reserve1);

      bool feeOn = _mintFee(_reserve0, _reserve1);
      uint _totalSupply = totalSupply();

      if (_totalSupply == 0) {
          liquidity = Math.sqrt(amount0.mul(amount1)).sub(MINIMUM_LIQUIDITY);
          _mint(address(0), MINIMUM_LIQUIDITY); // permanently lock the first MINIMUM_LIQUIDITY tokens
      } else {
          liquidity = Math.min(amount0.mul(_totalSupply) / _reserve0, amount1.mul(_totalSupply) / _reserve1);
      }

      require(liquidity > 0, 'DiamondPair: INSUFFICIENT_LIQUIDITY_MINTED');
      _mint(to, liquidity);

      _update(balance0, balance1, _reserve0, _reserve1);
      if (feeOn) kLast = uint(reserve0).mul(reserve1);

      emit Mint(msg.sender, amount0, amount1);
  }

  // Burn liquidity tokens
  function burn(address to) external nonReentrant returns (uint amount0, uint amount1) {
      (uint112 _reserve0, uint112 _reserve1,) = getReserves();
      address _token0 = token0;
      address _token1 = token1;
      uint balance0 = IERC20(_token0).balanceOf(address(this));
      uint balance1 = IERC20(_token1).balanceOf(address(this));
      uint liquidity = balanceOf(address(this));

      bool feeOn = _mintFee(_reserve0, _reserve1);
      uint _totalSupply = totalSupply();

      amount0 = liquidity.mul(balance0) / _totalSupply;
      amount1 = liquidity.mul(balance1) / _totalSupply;

      require(amount0 > 0 && amount1 > 0, 'DiamondPair: INSUFFICIENT_LIQUIDITY_BURNED');
      _burn(address(this), liquidity);

      _safeTransfer(_token0, to, amount0);
      _safeTransfer(_token1, to, amount1);

      balance0 = IERC20(_token0).balanceOf(address(this));
      balance1 = IERC20(_token1).balanceOf(address(this));

      _update(balance0, balance1, _reserve0, _reserve1);
      if (feeOn) kLast = uint(reserve0).mul(reserve1);

      emit Burn(msg.sender, amount0, amount1, to);
  }

  // Swap tokens
  function swap(uint amount0Out, uint amount1Out, address to, bytes calldata data) external nonReentrant {
      require(amount0Out > 0 || amount1Out > 0, 'DiamondPair: INSUFFICIENT_OUTPUT_AMOUNT');
      (uint112 _reserve0, uint112 _reserve1,) = getReserves();
      require(amount0Out < _reserve0 && amount1Out < _reserve1, 'DiamondPair: INSUFFICIENT_LIQUIDITY');

      uint balance0;
      uint balance1;
      { // scope for _token{0,1}, avoids stack too deep errors
          address _token0 = token0;
          address _token1 = token1;
          require(to != _token0 && to != _token1, 'DiamondPair: INVALID_TO');

          if (amount0Out > 0) _safeTransfer(_token0, to, amount0Out);
          if (amount1Out > 0) _safeTransfer(_token1, to, amount1Out);
          if (data.length > 0) IDiamondCallee(to).diamondCall(msg.sender, amount0Out, amount1Out, data);

          balance0 = IERC20(_token0).balanceOf(address(this));
          balance1 = IERC20(_token1).balanceOf(address(this));
      }

      uint amount0In = balance0 > _reserve0 - amount0Out ? balance0 - (_reserve0 - amount0Out) : 0;
      uint amount1In = balance1 > _reserve1 - amount1Out ? balance1 - (_reserve1 - amount1Out) : 0;
      require(amount0In > 0 || amount1In > 0, 'DiamondPair: INSUFFICIENT_INPUT_AMOUNT');

      { // scope for reserve{0,1}Adjusted, avoids stack too deep errors
          uint balance0Adjusted = balance0.mul(1000).sub(amount0In.mul(3));
          uint balance1Adjusted = balance1.mul(1000).sub(amount1In.mul(3));
          require(balance0Adjusted.mul(balance1Adjusted) >= uint(_reserve0).mul(_reserve1).mul(1000**2), 'DiamondPair: K');
      }

      _update(balance0, balance1, _reserve0, _reserve1);
      emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);
  }

  // Force balances to match reserves
  function skim(address to) external nonReentrant {
      address _token0 = token0;
      address _token1 = token1;
      _safeTransfer(_token0, to, IERC20(_token0).balanceOf(address(this)).sub(reserve0));
      _safeTransfer(_token1, to, IERC20(_token1).balanceOf(address(this)).sub(reserve1));
  }

  // Force reserves to match balances
  function sync() external nonReentrant {
      _update(
          IERC20(token0).balanceOf(address(this)),
          IERC20(token1).balanceOf(address(this)),
          reserve0,
          reserve1
      );
  }

  // Get reserves
  function getReserves() public view returns (uint112 _reserve0, uint112 _reserve1, uint32 _blockTimestampLast) {
      _reserve0 = reserve0;
      _reserve1 = reserve1;
      _blockTimestampLast = blockTimestampLast;
  }

  // Mint fee for protocol
  function _mintFee(uint112 _reserve0, uint112 _reserve1) private returns (bool feeOn) {
      address feeTo = IDiamondFactory(factory).feeTo();
      feeOn = feeTo != address(0);
      uint _kLast = kLast;

      if (feeOn) {
          if (_kLast != 0) {
              uint rootK = Math.sqrt(uint(_reserve0).mul(_reserve1));
              uint rootKLast = Math.sqrt(_kLast);

              if (rootK > rootKLast) {
                  uint numerator = totalSupply().mul(rootK.sub(rootKLast));
                  uint denominator = rootK.mul(IDiamondFactory(factory).protocolFeeDenominator()).add(rootKLast);
                  uint liquidity = numerator / denominator;

                  if (liquidity > 0) _mint(feeTo, liquidity);
              }
          }
      } else if (_kLast != 0) {
          kLast = 0;
      }
  }

  // Safe transfer
  function _safeTransfer(address token, address to, uint value) private {
      (bool success, bytes memory data) = token.call(abi.encodeWithSelector(IERC20.transfer.selector, to, value));
      require(success && (data.length == 0 || abi.decode(data, (bool))), 'DiamondPair: TRANSFER_FAILED');
  }
}

// Helper library for square root calculations
library Math {
  function min(uint x, uint y) internal pure returns (uint z) {
      z = x < y ? x : y;
  }

  function sqrt(uint y) internal pure returns (uint z) {
      if (y > 3) {
          z = y;
          uint x = y / 2 + 1;
          while (x < z) {
              z = x;
              x = (y / x + x) / 2;
          }
      } else if (y != 0) {
          z = 1;
      }
  }
}

interface IDiamondCallee {
  function diamondCall(address sender, uint amount0, uint amount1, bytes calldata data) external;
}

contracts/DiamondRouter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

interface IDiamondPair {
    function getReserves() external view returns (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast);
    function swap(uint amount0Out, uint amount1Out, address to, bytes calldata data) external;
    function token0() external view returns (address);
    function token1() external view returns (address);
    function mint(address to) external returns (uint liquidity);
    function burn(address to) external returns (uint amount0, uint amount1);
    function transferFrom(address from, address to, uint value) external returns (bool);
}

interface IDiamondFactory {
    function getPair(address tokenA, address tokenB) external view returns (address pair);
    function createPair(address tokenA, address tokenB) external returns (address pair);
    function allPairs(uint) external view returns (address pair);
    function allPairsLength() external view returns (uint);
}

contract DiamondRouter is Ownable, ReentrancyGuard {
    using SafeMath for uint;

    address public immutable factory;
    address public immutable WETH;

    // Events
    event Swap(
        address indexed sender,
        uint amountIn,
        uint amountOut,
        address indexed tokenIn,
        address indexed tokenOut
    );

    event LiquidityAdded(
        address indexed provider,
        address indexed tokenA,
        address indexed tokenB,
        uint amountA,
        uint amountB,
        uint liquidity
    );

    event LiquidityRemoved(
        address indexed provider,
        address indexed tokenA,
        address indexed tokenB,
        uint amountA,
        uint amountB,
        uint liquidity
    );

    constructor(address _factory, address _WETH) {
        factory = _factory;
        WETH = _WETH;
    }

    // Helper function to sort token addresses
    function sortTokens(address tokenA, address tokenB) internal pure returns (address token0, address token1) {
        require(tokenA != tokenB, 'DiamondRouter: IDENTICAL_ADDRESSES');
        (token0, token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
        require(token0 != address(0), 'DiamondRouter: ZERO_ADDRESS');
    }

    // Get pair address from factory
    function pairFor(address tokenA, address tokenB) public view returns (address pair) {
        return IDiamondFactory(factory).getPair(tokenA, tokenB);
    }

    // Get reserves for a token pair
    function getReserves(address tokenA, address tokenB) public view returns (uint reserveA, uint reserveB) {
        (address token0,) = sortTokens(tokenA, tokenB);
        address pair = pairFor(tokenA, tokenB);

        if (pair == address(0)) {
            return (0, 0);
        }

        (uint reserve0, uint reserve1,) = IDiamondPair(pair).getReserves();
        (reserveA, reserveB) = tokenA == token0 ? (reserve0, reserve1) : (reserve1, reserve0);
    }

    // Quote function to calculate equivalent amount
    function quote(uint amountA, uint reserveA, uint reserveB) public pure returns (uint amountB) {
        require(amountA > 0, 'DiamondRouter: INSUFFICIENT_AMOUNT');
        require(reserveA > 0 && reserveB > 0, 'DiamondRouter: INSUFFICIENT_LIQUIDITY');
        amountB = amountA.mul(reserveB) / reserveA;
    }

    // Calculate optimal amounts for adding liquidity
    function _calculateLiquidityAmounts(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) internal view returns (uint amountA, uint amountB) {
        // Check if pair exists
        address pair = pairFor(tokenA, tokenB);

        // If pair doesn't exist, just return the desired amounts
        if (pair == address(0)) {
            return (amountADesired, amountBDesired);
        }

        // Get reserves
        (uint reserveA, uint reserveB) = getReserves(tokenA, tokenB);

        if (reserveA == 0 && reserveB == 0) {
            return (amountADesired, amountBDesired);
        }

        // Calculate optimal amounts
        uint amountBOptimal = quote(amountADesired, reserveA, reserveB);
        if (amountBOptimal <= amountBDesired) {
            require(amountBOptimal >= amountBMin, 'DiamondRouter: INSUFFICIENT_B_AMOUNT');
            return (amountADesired, amountBOptimal);
        } else {
            uint amountAOptimal = quote(amountBDesired, reserveB, reserveA);
            assert(amountAOptimal <= amountADesired);
            require(amountAOptimal >= amountAMin, 'DiamondRouter: INSUFFICIENT_A_AMOUNT');
            return (amountAOptimal, amountBDesired);
        }
    }

    // Add liquidity to a pair
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to
    ) external nonReentrant returns (uint amountA, uint amountB, uint liquidity) {
        // Check if pair exists and create it if it doesn't
        address pair = pairFor(tokenA, tokenB);
        if (pair == address(0)) {
            pair = IDiamondFactory(factory).createPair(tokenA, tokenB);
        }

        // Calculate optimal amounts
        (amountA, amountB) = _calculateLiquidityAmounts(
            tokenA, tokenB, amountADesired, amountBDesired, amountAMin, amountBMin
        );

        // Transfer tokens to the pair
        _safeTransferFrom(tokenA, msg.sender, pair, amountA);
        _safeTransferFrom(tokenB, msg.sender, pair, amountB);

        // Add liquidity to the pair
        liquidity = IDiamondPair(pair).mint(to);

        emit LiquidityAdded(msg.sender, tokenA, tokenB, amountA, amountB, liquidity);
    }

    // Remove liquidity from a pair
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to
    ) public nonReentrant returns (uint amountA, uint amountB) {
        address pair = pairFor(tokenA, tokenB);

        // Transfer LP tokens to the pair
        IDiamondPair(pair).transferFrom(msg.sender, pair, liquidity);

        // Burn LP tokens and get tokens back
        (amountA, amountB) = IDiamondPair(pair).burn(to);

        require(amountA >= amountAMin, 'DiamondRouter: INSUFFICIENT_A_AMOUNT');
        require(amountB >= amountBMin, 'DiamondRouter: INSUFFICIENT_B_AMOUNT');

        emit LiquidityRemoved(msg.sender, tokenA, tokenB, amountA, amountB, liquidity);
    }

    // Calculate amount out based on amount in and reserves
    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) public pure returns (uint amountOut) {
        require(amountIn > 0, 'DiamondRouter: INSUFFICIENT_INPUT_AMOUNT');
        require(reserveIn > 0 && reserveOut > 0, 'DiamondRouter: INSUFFICIENT_LIQUIDITY');

        uint amountInWithFee = amountIn.mul(997); // 0.3% fee
        uint numerator = amountInWithFee.mul(reserveOut);
        uint denominator = reserveIn.mul(1000).add(amountInWithFee);
        amountOut = numerator / denominator;
    }

    // Calculate amount in based on amount out and reserves
    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) public pure returns (uint amountIn) {
        require(amountOut > 0, 'DiamondRouter: INSUFFICIENT_OUTPUT_AMOUNT');
        require(reserveIn > 0 && reserveOut > 0, 'DiamondRouter: INSUFFICIENT_LIQUIDITY');

        uint numerator = reserveIn.mul(amountOut).mul(1000);
        uint denominator = reserveOut.sub(amountOut).mul(997);
        amountIn = (numerator / denominator).add(1);
    }

    // Get amounts out for a path
    function getAmountsOut(uint amountIn, address[] memory path) public view returns (uint[] memory amounts) {
        require(path.length >= 2, 'DiamondRouter: INVALID_PATH');
        amounts = new uint[](path.length);
        amounts[0] = amountIn;

        for (uint i; i < path.length - 1; i++) {
            (uint reserveIn, uint reserveOut) = getReserves(path[i], path[i + 1]);
            amounts[i + 1] = getAmountOut(amounts[i], reserveIn, reserveOut);
        }
    }

    // Get amounts in for a path
    function getAmountsIn(uint amountOut, address[] memory path) public view returns (uint[] memory amounts) {
        require(path.length >= 2, 'DiamondRouter: INVALID_PATH');
        amounts = new uint[](path.length);
        amounts[amounts.length - 1] = amountOut;

        for (uint i = path.length - 1; i > 0; i--) {
            (uint reserveIn, uint reserveOut) = getReserves(path[i - 1], path[i]);
            amounts[i - 1] = getAmountIn(amounts[i], reserveIn, reserveOut);
        }
    }

    // Swap exact tokens for tokens
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to
    ) external nonReentrant returns (uint[] memory amounts) {
        amounts = getAmountsOut(amountIn, path);
        require(amounts[amounts.length - 1] >= amountOutMin, 'DiamondRouter: INSUFFICIENT_OUTPUT_AMOUNT');
        _safeTransferFrom(path[0], msg.sender, pairFor(path[0], path[1]), amounts[0]);
        _swap(amounts, path, to);

        emit Swap(msg.sender, amountIn, amounts[amounts.length - 1], path[0], path[path.length - 1]);
    }

    // Swap tokens for exact tokens
    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to
    ) external nonReentrant returns (uint[] memory amounts) {
        amounts = getAmountsIn(amountOut, path);
        require(amounts[0] <= amountInMax, 'DiamondRouter: EXCESSIVE_INPUT_AMOUNT');
        _safeTransferFrom(path[0], msg.sender, pairFor(path[0], path[1]), amounts[0]);
        _swap(amounts, path, to);

        emit Swap(msg.sender, amounts[0], amountOut, path[0], path[path.length - 1]);
    }

    // Internal swap function
    function _swap(uint[] memory amounts, address[] memory path, address _to) internal {
        for (uint i; i < path.length - 1; i++) {
            (address input, address output) = (path[i], path[i + 1]);
            (address token0,) = sortTokens(input, output);
            uint amountOut = amounts[i + 1];
            (uint amount0Out, uint amount1Out) = input == token0 ? (uint(0), amountOut) : (amountOut, uint(0));
            address to = i < path.length - 2 ? pairFor(output, path[i + 2]) : _to;
            IDiamondPair(pairFor(input, output)).swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    // Safe transfer from
    function _safeTransferFrom(address token, address from, address to, uint value) private {
        (bool success, bytes memory data) = token.call(
            abi.encodeWithSelector(IERC20.transferFrom.selector, from, to, value)
        );
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'DiamondRouter: TRANSFER_FAILED');
    }
}

